import React from 'react';
import './Home.css';
import { ReactComponent as NameSVG } from '../../name.svg';
import TypeWriter from 'typewriter-react';

function Home() {
    return(
        <div className="nameContainer">
            <NameSVG />
            <TypeWriter
                input={[
                    "Software Engineer",
                    {"pause": 5},
                    {"delete": 5},
                    "Developer"
                ]}
                speed={75}
                cursor={true}
                cursorChar="|"
            />
        </div>
    );
}

export default Home;
